  const src  = URL.createObjectURL(blob);
  const f = document.createElement("iframe");
  f.setAttribute("sandbox","allow-scripts allow-forms allow-popups allow-same-origin");
  f.src = src; document.body.appendChild(f);
  $("#gate").classList.add("hide");
  for(let i=0;i<CHUNKS.length;i++) CHUNKS[i]="";
  try{ history.replaceState({}, document.title, location.pathname); }catch(e){}
  setTimeout(()=>URL.revokeObjectURL(src), 30000);
}
